  true,\n\t\"url\": null,\n\t\"notes\": \"Powerful personal computers, high-bandwidth
  and wireless networking technologies, and the widespread use of the Internet have
  transformed stand-alone computing systems and predominantly closed networks into
  the virtually seamless fabric of today`s information technology IT infrastructure.
  This infrastructure provides for the processing, transmission, and storage of vast
  amounts of vital information used in virtually every facet of society, and it enables
  Federal agencies to routinely interact with each other as well as with industry,
  private citizens, state and local governments, and the governments of other nations...\",\n\t\"license_title\":
